import React from "react";

import "./style.css";
const cnst_bg = require("../../assets/cnst_bg4.jpg").default;
const Construction = () => {
  return (
    <div className="justify-content-center row">
      <div
        className=""
        style={{
          position: "absolute",
          textAlign: "center",
          justifyContent: "center",
          alignItems: "center",
          color: "white",
          fontWeight: "bold",
          flex: 1,
          marginTop: "10%",
        }}
      >
        <div className="col">
          <div className="col">
            <p className="row" style={{ fontSize: 40 }}>
              We build quality Homes
            </p>

            <p className="row" style={{ fontSize: 30 }}>
              100% Hassle-Free and Managed by us!
            </p>
          </div>
          {/* <div className="border col" style={{ width: 100, height: 120 }}>
            Hi
          </div> */}
        </div>
        {/* <div className="col">sd d ssdsds</div> */}
      </div>
      <img src={cnst_bg} style={styles.image} />
    </div>
  );
};

const styles = {
  p: {
    fontSize: 25,
    marginTop: "15%",
    textAlign: "center",
    maxWidth: 700,
  },
  image: {
    width: "100%",
    // height: "10",
    opacity: "0.5",
  },
};
export default Construction;
